/*
	GM_getValue abstraction
	
*/
DOngsMacros.GetSetting = function(usersetting, defaultvar){
	if ( typeof( localStorage) != 'undefined') {
		if ( ( localStorage.getItem(usersetting) == null  ) || ( localStorage.getItem(usersetting) == '') ){
			return defaultvar;
		} else {
			var splorg = localStorage.getItem(usersetting);
			
			if (splorg == '1'){splorg=true};
			if (splorg == '0'){splorg=false};
			return splorg;
		};
	} else {
		return defaultvar;
	};
};
/*
	Not really used, but here anyway
*/
DOngsMacros.SetSetting = function(usersetting, settingvar){
	//localStorage
	if (typeof( localStorage) != 'undefined') {
		if (settingvar == true){settingvar='1'};
		if (settingvar == false){settingvar='0'};
		localStorage.setItem(usersetting, settingvar)
	};
};
/*
	Blacklisting, and other shit
*/
DOngsMacros.LoadFilter = function(thelist){
	var poop = DOngsMacros.GetSetting(thelist, 'fake1,fake2');
	if (poop) {
		return poop.split(',');
	}else{
		return ['fake1','fake2'];
	}
};
DOngsMacros.AddCSS = function(cssstr){
	var head = document.getElementsByTagName('head')[0];
	if (!head) { return; }
	var style = document.createElement('style');
	style.type = 'text/css';
	style.innerHTML = cssstr;
	head.appendChild(style);
};
//Add any custom js DOngsMacros.AddJS
DOngsMacros.AddJS = function(jsstring) {
	var addedjs = document.createElement('script');
	addedjs.type='text/javascript';
	
	addedjs.appendChild( document.createTextNode( jsstring ) )
	document.getElementsByTagName('head')[0].appendChild( addedjs );
};
